import React, { Component } from "react";
import $ from "jquery";

class Search extends Component {
  getUserLocation = () => {
    $.getJSON(
      "https://ipfind.co/?ip=14.161.14.93&auth=1b266364-9b53-404e-b34d-6c925872c37e",
      function (data) {
        $("#a1").html("quoc gia : " + data);
        console.log(data);
        $("#a2").html("khu vuc : " + data.city);
        $("#a3").html("IP :" + data.region);
      }
    );
  };
  render() {
    return (
      <div className="justify-content-center text-justify text-center">
        <div id="align-top"></div>

        <h2> Tìm kiếm những dự án bất động sản hiện có xung quanh bạn</h2>
        ,

        {this.getUserLocation()}

        <table class="table table-bordered">

          <thead>
            <tr>
              <th scope="col" colspan="2">Thông tin của bạn</th>
              
             
            </tr>
          </thead>

          <tbody>
            <tr>
              <th scope="row">1</th>
              <td>Mark</td>
            </tr>

            <tr>
              <th scope="row">2</th>
              <td>Jacob</td>
            </tr>

            <tr>
              <th scope="row" colspan="2">Button</th>
              
            </tr>

          </tbody>

        </table>

      </div>
    );
  }
}

export default Search;
